	// now we have a size -- as long as it's less than 512MB, we'll pad it out
    // Carts > 32MB use the 4 LSB of the data bus as the most MSB latch bits, after all 12 address bits
    // note that the theorhetical maximum, if you used all 8 data bits, would be 8 giabytes! (20 latch bits + 13 address bits for 33 address bits total)
	if (tmp > 512*1024*1024) {
		printf("Not padding file - larger than 512MB which is the largest currently available.\n");
	} else {
		// we use dumpad for this, which is all laid out as expected with header and mute bytes
		while (fsize < tmp) {
			int cnt = tmp - fsize;
			if (cnt > 8192) cnt = 8192;
			fwrite(dumpad, 1, cnt, fOut);
			fsize+=cnt;
		}
	}
	fclose(fOut);
	
	return 0;
